import React, { useState, useEffect } from 'react';
import { FiUsers, FiFilm, FiMapPin, FiDollarSign, FiTrendingUp, FiPlus } from 'react-icons/fi';
import api from '../../services/api';
import { toast } from 'react-hot-toast';
import { useAuth } from '../../context/AuthContext';

const SuperAdminDashboard = () => {
  const { user } = useAuth();
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalTheaters: 0,
    totalMovies: 0,
    totalBookings: 0,
    totalRevenue: 0,
    monthlyRevenue: []
  });
  const [recentActivity, setRecentActivity] = useState([]);
  const [theaters, setTheaters] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [statsRes, activityRes, theatersRes] = await Promise.all([
        api.get('/admin/stats'),
        api.get('/admin/recent-activity'),
        api.get('/theaters')
      ]);

      setStats(statsRes.data.data || {});
      setRecentActivity(activityRes.data.data?.activities || []);
      setTheaters(theatersRes.data.data?.theaters || []);
    } catch (error) {
      toast.error('Failed to fetch dashboard data');
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleApproveTheater = async (theaterId) => {
    try {
      await api.patch(`/admin/theaters/${theaterId}/approve`);
      toast.success('Theater approved successfully');
      fetchDashboardData();
    } catch (error) {
      toast.error('Failed to approve theater');
      console.error('Error approving theater:', error);
    }
  };

  const handleRejectTheater = async (theaterId) => {
    if (!window.confirm('Are you sure you want to reject this theater?')) {
      return;
    }

    try {
      await api.patch(`/admin/theaters/${theaterId}/reject`);
      toast.success('Theater rejected');
      fetchDashboardData();
    } catch (error) {
      toast.error('Failed to reject theater');
      console.error('Error rejecting theater:', error);
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 py-8">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-center items-center h-64">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600"></div>
          </div>
        </div>
      </div>
    );
  }

  const pendingTheaters = theaters.filter(theater => theater.status === 'pending');

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">Super Admin Dashboard</h1>
          <p className="text-gray-600">Welcome back, {user?.name}! Here's what's happening with your platform.</p>
        </div>

        {/* Stats Cards */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="flex items-center">
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-600">Total Users</p>
                <p className="text-3xl font-bold text-gray-900">{stats.totalUsers || 0}</p>
              </div>
              <div className="ml-4">
                <FiUsers className="h-8 w-8 text-primary-600" />
              </div>
            </div>
            <div className="mt-2">
              <span className="text-sm text-green-600">+12% from last month</span>
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="flex items-center">
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-600">Total Theaters</p>
                <p className="text-3xl font-bold text-gray-900">{stats.totalTheaters || 0}</p>
              </div>
              <div className="ml-4">
                <FiMapPin className="h-8 w-8 text-blue-600" />
              </div>
            </div>
            <div className="mt-2">
              <span className="text-sm text-blue-600">{pendingTheaters.length} pending approval</span>
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="flex items-center">
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-600">Total Movies</p>
                <p className="text-3xl font-bold text-gray-900">{stats.totalMovies || 0}</p>
              </div>
              <div className="ml-4">
                <FiFilm className="h-8 w-8 text-purple-600" />
              </div>
            </div>
            <div className="mt-2">
              <span className="text-sm text-purple-600">+5 added this week</span>
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="flex items-center">
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-600">Total Revenue</p>
                <p className="text-3xl font-bold text-gray-900">â‚¹{(stats.totalRevenue || 0).toLocaleString()}</p>
              </div>
              <div className="ml-4">
                <FiDollarSign className="h-8 w-8 text-green-600" />
              </div>
            </div>
            <div className="mt-2">
              <span className="text-sm text-green-600">+18% from last month</span>
            </div>
          </div>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          {/* Pending Theater Approvals */}
          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="flex items-center justify-between mb-6">
              <h2 className="text-xl font-semibold text-gray-900">Pending Theater Approvals</h2>
              <span className="bg-red-100 text-red-800 text-sm font-medium px-2.5 py-0.5 rounded-full">
                {pendingTheaters.length}
              </span>
            </div>

            {pendingTheaters.length === 0 ? (
              <div className="text-center py-8">
                <FiMapPin className="mx-auto h-12 w-12 text-gray-400 mb-4" />
                <p className="text-gray-500">No pending theater approvals</p>
              </div>
            ) : (
              <div className="space-y-4">
                {pendingTheaters.slice(0, 5).map((theater) => (
                  <div key={theater._id} className="flex items-center justify-between p-4 border border-gray-200 rounded-lg">
                    <div>
                      <h3 className="font-medium text-gray-900">{theater.name}</h3>
                      <p className="text-sm text-gray-600">{theater.location}</p>
                      <p className="text-xs text-gray-500">Requested: {new Date(theater.createdAt).toLocaleDateString()}</p>
                    </div>
                    <div className="flex gap-2">
                      <button
                        onClick={() => handleApproveTheater(theater._id)}
                        className="px-3 py-1 bg-green-600 text-white text-sm rounded-md hover:bg-green-700 transition-colors"
                      >
                        Approve
                      </button>
                      <button
                        onClick={() => handleRejectTheater(theater._id)}
                        className="px-3 py-1 bg-red-600 text-white text-sm rounded-md hover:bg-red-700 transition-colors"
                      >
                        Reject
                      </button>
                    </div>
                  </div>
                ))}
                {pendingTheaters.length > 5 && (
                  <div className="text-center">
                    <button className="text-primary-600 hover:text-primary-700 text-sm font-medium">
                      View all {pendingTheaters.length} pending approvals
                    </button>
                  </div>
                )}
              </div>
            )}
          </div>

          {/* Recent Activity */}
          <div className="bg-white rounded-lg shadow-sm p-6">
            <h2 className="text-xl font-semibold text-gray-900 mb-6">Recent Activity</h2>

            {recentActivity.length === 0 ? (
              <div className="text-center py-8">
                <FiTrendingUp className="mx-auto h-12 w-12 text-gray-400 mb-4" />
                <p className="text-gray-500">No recent activity</p>
              </div>
            ) : (
              <div className="space-y-4">
                {recentActivity.slice(0, 8).map((activity, index) => (
                  <div key={index} className="flex items-start gap-3">
                    <div className="w-2 h-2 bg-primary-600 rounded-full mt-2 flex-shrink-0"></div>
                    <div>
                      <p className="text-sm text-gray-900">{activity.description}</p>
                      <p className="text-xs text-gray-500">{new Date(activity.timestamp).toLocaleString()}</p>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>

        {/* Quick Actions */}
        <div className="mt-8 bg-white rounded-lg shadow-sm p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-6">Quick Actions</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <button className="flex items-center gap-3 p-4 border border-gray-300 rounded-lg hover:bg-gray-50 transition-colors">
              <FiPlus className="w-6 h-6 text-primary-600" />
              <div className="text-left">
                <p className="font-medium text-gray-900">Add New Movie</p>
                <p className="text-sm text-gray-600">Add a new movie to the platform</p>
              </div>
            </button>

            <button className="flex items-center gap-3 p-4 border border-gray-300 rounded-lg hover:bg-gray-50 transition-colors">
              <FiUsers className="w-6 h-6 text-blue-600" />
              <div className="text-left">
                <p className="font-medium text-gray-900">Manage Users</p>
                <p className="text-sm text-gray-600">View and manage user accounts</p>
              </div>
            </button>

            <button className="flex items-center gap-3 p-4 border border-gray-300 rounded-lg hover:bg-gray-50 transition-colors">
              <FiTrendingUp className="w-6 h-6 text-green-600" />
              <div className="text-left">
                <p className="font-medium text-gray-900">View Reports</p>
                <p className="text-sm text-gray-600">Generate platform analytics</p>
              </div>
            </button>
          </div>
        </div>

        {/* System Status */}
        <div className="mt-8 bg-white rounded-lg shadow-sm p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-6">System Status</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="text-center">
              <div className="w-12 h-12 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-3">
                <div className="w-3 h-3 bg-green-600 rounded-full"></div>
              </div>
              <h3 className="font-medium text-gray-900">API Status</h3>
              <p className="text-sm text-green-600">Operational</p>
            </div>

            <div className="text-center">
              <div className="w-12 h-12 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-3">
                <div className="w-3 h-3 bg-green-600 rounded-full"></div>
              </div>
              <h3 className="font-medium text-gray-900">Database</h3>
              <p className="text-sm text-green-600">Operational</p>
            </div>

            <div className="text-center">
              <div className="w-12 h-12 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-3">
                <div className="w-3 h-3 bg-green-600 rounded-full"></div>
              </div>
              <h3 className="font-medium text-gray-900">Payment Gateway</h3>
              <p className="text-sm text-green-600">Operational</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
